import React, {Component} from "react";
import {Button} from "reactstrap"

class LoginAndRegister extends Component{
  render(){
    return(
      <div>
      <Button link="/Login">Login</Button>
      <Button link="/Register">Register</Button>
      </div>
    )
  }
}
export default LoginAndRegister;
